import React from "react";

function SettingImageWithAbsoultValue({
  imgUrl,
  top = "auto",
  bottom = "auto",
  right = "auto",
  left = "auto",
}) {
  return (

    <img
      src={imgUrl}
      alt="#"
      style={{
        width: `100%`,
        top: { top },
        bottom: { bottom },
        right: { right },
        left: { left },
      }}
    />
  );
}

export default SettingImageWithAbsoultValue;
